rule OSXDummy {   
      	meta:      
      		author = "jaime.blasco@alienvault.com"      
      		tlp = "white"     
      		reference1= "https://objective-see.com/blog/blog_0x32.html"   
   	strings:   
   	    $header0 = {cf fa ed fe}   
   	    $header1 = {ce fa ed fe}   
   	    $header2 = {ca fe ba be}   
   	    $st1 = "/tmp/com.startup.plist" wide ascii   
   	    $st2 = "/Library/LaunchDaemons/com.startup.plist"   
   	    $st3 = "socket.AF_INET,socket.SOCK_STREAM"   
   	condition:   
   		($header0 at 0 or $header1 at 0 or $header2 at 0) and all of ($st*)    
   }

rule OSXCalisto : MacOSXMalware {      
      	meta:      
      		author = "jaime.blasco@alienvault.com"      
      		tlp = "white"      
      		reference1= "https://securelist.com/calisto-trojan-for-macos/86543/"      
      	strings:      
          $header0 = { cf fa ed fe }      
          $header1 = { ce fa ed fe }      
          $header2 = { ca fe ba be }      
   	   $st1 = "/calisto/listenyee.php"      
   	   $st2 = "rm -rf ~/.calisto/"      
   	   $st3 = "/Library/LaunchAgents/com.proton.calisto.plist"       
      	condition:      
      		($header0 at 0 or $header1 at 0 or $header2 at 0) and any of ($st*)      
   }

